function onLoad()
    data = {
        Blue = {
            name, descdescription
        },
        Red = {
            name, desc
        },
    }
end
function onScriptingButtonDown(index, player)
    if index==1 then
        data[player].name = Player[player].getHoverObject().getName()
        data[player].desc = Player[player].getHoverObject().getDescription()
        broadcastToColor("Copied", player, "Green")
    elseif index == 2 then
        Player[player].getHoverObject().setName(data[player].name)
        Player[player].getHoverObject().setDescription(data[player].desc)
        broadcastToColor("Pasted", player, "Blue")
    end
    if index==3 then
        local deck = Player[player].getHoverObject()
        if deck.tag~="Deck" then return false else end
        for i=1, #deck.getObjects() do
            deck.takeObject({
                position = deck.getPosition() + (self.getTransformRight() * i * 2 * -1)
            })
        end
    end
end
